(window.webpackJsonp=window.webpackJsonp||[]).push([[99],{kLPX:function(e){e.exports=[{id:1,type:"  skytap_project",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> User-defined project name.\n",elementType:"li",listDepth:1},{name:"summary",description:"<strong>(Optional)</strong> User-defined description of project.\n",elementType:"li",listDepth:1},{name:"auto_add_role_name",description:'<strong>(Optional)</strong> If this field is set to <code>viewer</code>, <code>participant</code>, <code>editor</code>, or <code>manager</code>, new users added to your Skytap account are automatically added to this project with the specified project role. Existing users aren\u2019t affected by this setting. If the field is set to <code>null</code>, new users aren\u2019t automatically added to the project. For additional details, see <a href="https://help.skytap.com/csh-project-automatic-role.html">Automatically adding new users to a project</a>.\n',elementType:"li",listDepth:1},{name:"show_project_members",description:"<strong>(Optional)</strong> Determines whether projects members can view a list of other project members. False by default.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/skytap/r/project.html",docType:""},{id:2,type:"  skytap_environment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"template_id",description:"(Required, Force New) ID of the template you want to create an environment from. If updating with a new one then the environment will be recreated.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> User-defined name of the environment. Limited to 255 characters. UTF-8 character type. Will default to source template\u2019s name if null is provided.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Required)</strong> User-defined description of the environment. Limited to 1000 characters. Null allowed. UTF-8 character type.\n",elementType:"li",listDepth:1},{name:"outbound_traffic",description:"<strong>(Optional)</strong> Indicates whether networks in the environment can send outbound traffic.\n",elementType:"li",listDepth:1},{name:"routable",description:"<strong>(Optional)</strong> Indicates whether networks within the environment can route traffic to one another.\n",elementType:"li",listDepth:1},{name:"suspend_on_idle",description:"<strong>(Optional)</strong> The number of seconds an environment can be idle before it is automatically suspended. Valid range: 300 to 86400 seconds (5 minutes to 1 day).\n",elementType:"li",listDepth:1},{name:"suspend_at_time",description:"<strong>(Optional)</strong> The date and time that the environment will be automatically suspended. Format: yyyy/mm/dd hh:mm:ss. By default, the suspend time uses the UTC offset for the time zone defined in your user account settings. Optionally, a different UTC offset can be supplied (for example: 2018/07/20 14:20:00 -0000). The value in the API response is converted to your time zone.\n",elementType:"li",listDepth:1},{name:"shutdown_on_idle",description:"<strong>(Optional)</strong> The number of seconds an environment can be idle before it is automatically shut down. Valid range: 300 to 86400 seconds (5 minutes to 1 day).\n",elementType:"li",listDepth:1},{name:"shutdown_at_time",description:"<strong>(Optional)</strong> The date and time that the environment will be automatically shut down. Format: yyyy/mm/dd hh:mm:ss. By default, the suspend time uses the UTC offset for the time zone defined in your user account settings. Optionally, a different UTC offset can be supplied (for example: 2018/07/20 14:20:00 -0000). The value in the API response is converted to your time zone.\n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong>\n* If <code>suspend_on_idle</code> and <code>suspend_at_time</code> are both null, automatic suspend is disabled.\n* If <code>shutdown_on_idle</code> and <code>shutdown_at_time</code> are both null, automatic shut down is disabled.\n* An environment cannot be set to automatically suspend and shut down. Only one of the following settings can take effect: <code>suspend_on_idle</code>, <code>suspend_at_time</code>, <code>shutdown_on_idle</code>, or <code>shutdown_at_time</code>.\n* When you send a request that updates one of the four suspend or shutdown options, the other three options are automatically set to null by the REST API.\n* If multiple suspend or shut down options are sent in the same request, the <code>suspend_type</code> field determines which setting Skytap Cloud will honor.</p>\n</div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/skytap/r/environment.html",docType:""},{id:3,type:"  skytap_network",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"environment_id",description:"(Required, Force New) ID of the environment you want to attach the network to. If updating with a new one then the network will be recreated.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> User-defined name of the network. Limited to 255 characters. UTF-8 character type.\n",elementType:"li",listDepth:1},{name:"domain",description:"<strong>(Required)</strong> Domain name for the Skytap network. Limited to 64 characters.\n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> Valid characters are lowercase letters, numbers, and hyphens. Cannot be blank, must not begin or end with a period, and must start and end with a letter or number. This field can be changed only when all virtual machines in the environment are stopped (not suspended or running).</p>\n</div>',elementType:"div"},{name:"subnet",description:"<strong>(Required)</strong> Defines the subnet address and subnet mask size in CIDR format (for example, 10.0.0.0/24). IP addresses for the VMs are assigned from this subnet and standard network services (DNS resolution, CIFS share, routes to Internet) are defined appropriately for it.\n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> The subnet mask size must be between 16 and 29. Valid characters are lowercase letters, numbers, and hyphens. Cannot be blank, must not begin or end with a period, and must start and end with a letter or number.</p>\n</div>',elementType:"div"},{name:"gateway",description:"(Optional, Computed) Gateway IP address.\n",elementType:"li",listDepth:1},{name:"tunnelable",description:"<strong>(Optional)</strong> If true, this network can be connected to other networks.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/skytap/r/network.html",docType:""},{id:4,type:"  skytap_vm",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"environment_id",description:"(Required, Force New) ID of the environment you want to add the VM to. If updating with a new one then the VM will be recreated.\n",elementType:"li",listDepth:1},{name:"template_id",description:"(Required, Force New) ID of the template you want to create the vm from. If updating with a new one then the VM will be recreated.\n",elementType:"li",listDepth:1},{name:"vm_id",description:"(Required, Force New) ID of the VM you want to create the VM from. If updating with a new one then the VM will be recreated.\n",elementType:"li",listDepth:1},{name:"name",description:"(Optional, Computed) User-defined name. Limited to 100 characters. \n",elementType:"li",listDepth:1},{name:"cpus",description:"(Optional, Computed) Number of CPUs allocated to this virtual machine. Valid range is 1 to 12. Maximum limit depends on the <code>max_cpus</code> setting.\n",elementType:"li",listDepth:1},{name:"ram",description:"(Optional, Computed) Amount of RAM allocated to this VM. Valid range is 256 and 131,072 (MB). Maximum limit depends on <code>max_ram</code> setting.\n",elementType:"li",listDepth:1},{name:"os_disk_size",description:"(Optional, Computed) The size of the OS disk. The disk size is in MiB; it will be converted to GiB in the Skytap UI. The maximum disk size is 2,096,128 MiB (1.999 TiB).\n",elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="disk"></a><a href="#disk"><code>disk</code></a> - (Optional) Array of virtual disks within the VM. The disk size is in MiB; it will be converted to GiB in the Skytap UI. The maximum disk size is 2,096,128 MiB (1.999 TiB).</p>',elementType:"p"},{name:"name",description:"<strong>(Required)</strong> A unique name for the disk.\n",elementType:"li",listDepth:2},{name:"size",description:"<strong>(Required)</strong> Specify the size of the disk. The new disk\u2019s size should be provided in MiB. The minimum disk size is 2048 MiB; the maximum is 2096128 MiB (1.999 TiB).\n",elementType:"li",listDepth:2},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> The name will be truncated to 33 UTF-8 characters after saving. If a name is not provided then the source VM\'s name will be used.</p>\n</div>',elementType:"div"},{name:"list description",description:'<a name="network_interface"></a>',elementType:"p"},{name:"interface_type",description:"(Required, Force New) Type of network that this network adapter is attached to.\n",elementType:"li",listDepth:2},{name:"network_id",description:"(Required, Force New) ID of the network that this network adapter is attached to.\n",elementType:"li",listDepth:2},{name:"ip",description:"(Required, Force New) The IP address (for example, 10.1.0.37). Skytap will not assign the same IP address to multiple interfaces on the same network.\n",elementType:"li",listDepth:2},{name:"hostname",description:"(Required, Force New) Limited to 32 characters. Valid characters are lowercase letters, numbers, and hyphens. Cannot begin or end with hyphens. Cannot be <code>gw</code>.\n",elementType:"li",listDepth:2},{name:"published_service",description:"(Optional, Force New) Generally, a published service represents a binding of a port on a network interface to an IP and port that is routable and accessible from the public Internet. This mechanism is used to selectively expose ports on the guest to the public Internet.\n",elementType:"li",listDepth:2},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>NOTE:</strong> Published services exist and are managed as aspects of network interfaces\u2014that is, as part of the overall environment element.</p>\n</div>',elementType:"div"},{name:"",description:'<div class="highlight"><pre class="highlight plaintext"><code>* `name` - (Required, Force New) A unique name for the published service.\n* `internal_port` - (Required, Force New) The port that is exposed on the interface. Typically this will be dictated by standard usage (e.g., port 80 for http traffic, port 22 for SSH).\n</code></pre></div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/skytap/r/vm.html",docType:""}]}}]);